import React from 'react';

// import { Container } from './styles';

export default function CreateAlbums() {
  return (
    <div className="box">
        <h1 className="title">Criar novo album</h1>

        <div className="field">

            <div className="control">
                <input type="text" className="input"placeholder="Nome do album"/>
            </div>

            <div className="control">
                <input type="text" className="input"placeholder="Nome do artista"/>
            </div>

        </div>

    </div>
  );
}
